import React, { Component } from "react";
import { connect } from "react-redux";
// import "./FeaturedDoctors.scss";
import { FormattedMessage } from "react-intl";
// import Slider from "react-slick";
// import "slick-carousel/slick/slick.css";
// import "slick-carousel/slick/slick-theme.css";
// import medicalImg from "../../../assets/FeaturedDoctors/1.jpg";
import Carousel from "react-bootstrap/Carousel";
import ExampleCarouselImage from "../../../components/ExampleCarouselImage";
import medicalImg from "../../../assets/medical/1.jpg";
class FeaturedDoctors extends Component {
    render() {
        let settings = {
            dots: false,
            infinite: true,
            speed: 500,
            slidesToShow: 4,
            slidesToScroll: 2,
            nextArrow: <div className="slick-next"></div>,
            prevArrow: <div className="slick-prev"></div>,
        };
        return (
            <React.Fragment>
<div className="custom-carousel">
      <h2 className="carousel-title">CHUYÊN KHOA</h2>
      <Carousel>
        <Carousel.Item>
          <ExampleCarouselImage 
            images={[
              'https://mdbootstrap.com/img/new/slides/041.jpg',
              'https://mdbootstrap.com/img/new/slides/042.jpg',
              'https://mdbootstrap.com/img/new/slides/043.jpg'
            ]}
            title="Bệnh viện Bạch Mai"
          />
          <Carousel.Caption>
            <h3>First slide label</h3>
            <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <ExampleCarouselImage 
            images={[
              'https://mdbootstrap.com/img/new/slides/041.jpg',
              'https://mdbootstrap.com/img/new/slides/042.jpg',
              'https://mdbootstrap.com/img/new/slides/043.jpg'
            ]}
            title="Bệnh viện Bạch Mai"
          />
          <Carousel.Caption>
            <h3>Second slide label</h3>
            <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <ExampleCarouselImage 
            images={[
              'https://mdbootstrap.com/img/new/slides/041.jpg',
              'https://mdbootstrap.com/img/new/slides/042.jpg',
              'https://mdbootstrap.com/img/new/slides/043.jpg'
            ]}
            title="Bệnh viện Bạch Mai"
          />
          <Carousel.Caption>
            <h3>Third slide label</h3>
            <p>Praesent commodo cursus magna, vel scelerisque nisl consectetur.</p>
          </Carousel.Caption>
        </Carousel.Item>
      </Carousel>
      <button type="button" className="btn btn-primary mt-3">Tìm kiếm</button>
    </div>
            </React.Fragment>
        );
    }
}

const mapStateToProps = (state) => {
    return {
        language: state.app.language,
        isLoggedIn: state.user.isLoggedIn,
    };
};

const mapDispatchToProps = (dispatch) => {
    return {};
};

export default connect(mapStateToProps, mapDispatchToProps)(FeaturedDoctors);
